import React from 'react';
import MovieItem from './movieitem';

class Movies extends React.Component{

    render(){
        return this.props.myMovies.map((movie)=>{
            //console.log({movie});
            return <MovieItem key={movie._id} movie={movie}></MovieItem>
        });
    }
}
export default Movies;
